import plusIcon from "./icons/plus.png";
import crossIcon from "./icons/cross.png";
import editIcon from "./icons/dots.png";
import backArrowIcon from "./icons/backarrow.png";

const icons = {
    plusIcon,
    crossIcon,
    editIcon,
    backArrowIcon
}

export{icons}
